import {
  ShieldExclamationIcon,
  TemplateIcon,
  RectangleStackIcon,
  Cog6ToothIcon,
} from "@heroicons/react/outline";

export const navLinks = [
  {
    id: 0,
    title: "Signalement",
    icon: <ShieldExclamationIcon className="nav-icon" />,
  },
  {
    id: 1,
    title: "Dashboard",
    icon: <TemplateIcon className="nav-icon" />,
  },
  {
    id: 2,
    title: "Tasks",
    icon: <TemplateIcon className="nav-icon" />,
  },
  {
    id: 3,
    title: "Settings",
    icon: <TemplateIcon className="nav-icon" />,
  },
];
